import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css';

const ProjectBox = ({ title, link, image }) => {
  return (
    <div className="project-box">
      <Link to={link}>
        <h3>{title}</h3>
        <img src={image} alt={title} />
      </Link>
    </div>
  );
};

export default ProjectBox;
